import './App.css';
import React from "react"
import Product from "./components/Product"
import productsData from "./components/VProduct"

function App() {
  const productComponents=productsData.map(item => <Product keys={item.id} products={item}/>)
  return (
    <div>
      {productComponents}
    </div>
  )  
}

export default App;
